constexpr size_t masks_count = sizeof(masks)/sizeof(GroupMask);
constexpr int bit_count = 26;
unordered_map<uint32_t, uint32_t> pruned_searches;
uint16_t next_bit_index[bit_count] = {0};
constexpr GroupMask SOLUTION_MASK = (1 << bit_count) - 1;

void useless_function_for_demonstration_purposes() {}

#ifdef SIXTY_PERCENT_SLOWDOWN
#else
void thanks_jcc_erratum() {}
#endif

bool cover(const GroupMask cumulative_mask, const int depth, const size_t start) noexcept {
    if (cumulative_mask == SOLUTION_MASK) {
        return true;
    }

    size_t end = min(masks_count, (size_t)next_bit_index[__builtin_ctz(~cumulative_mask)]);
    const uint32_t pruning_key = depth | (cumulative_mask << 3);

    const auto& it = pruned_searches.find(pruning_key);
    uint32_t* previous_prune_idx = nullptr;
    if (it != pruned_searches.end()) {
        if (it->second <= start) {
            end = min(end, (size_t)it->second);
        }

        previous_prune_idx = &it->second;
    }

    bool found = false;
    size_t prune_idx = start;
    GroupMask& stack_mask = stack[depth];

    for (size_t idx = start; idx < end; idx++) {
        const GroupMask mask = masks[idx];
        const GroupMask new_mask = cumulative_mask | mask;
        if (popcount(new_mask) <= 5*depth) {
            continue;
        }
        stack_mask = mask;
        if (cover(new_mask, depth+1, idx+1)) {
            prune_idx = idx+1;
            found = true;
        }
    }

    if (prune_idx < end) {
        if (previous_prune_idx != nullptr) {
            *previous_prune_idx = prune_idx;
        } else {
            pruned_searches[pruning_key] = prune_idx;
        }
    }

    return found;
}


void setup_bit_index() {
    int idx = 0;
    int previous_first_zero = __builtin_ctz(masks[0]); // Should be 0 otherwise there are no solutions
    
    for (size_t i=0; i<masks_count; i++) {
        int first_zero = __builtin_ctz(masks[i]);
        if (first_zero > previous_first_zero) {
            for (int n = previous_first_zero; n < first_zero; n++) {
                next_bit_index[idx++] = i;
            }
            previous_first_zero = first_zero;
        }
    }
    while (idx < bit_count) {
        next_bit_index[idx++] = masks_count;
    }
}

int main(void) {
    setup_bit_index();
    cover(0, 0, 0);
}
